import axios from 'axios'

const baseUrl = process.env.REACT_APP_BASE_URL

//para consumir la API
export async function getProducts () {
    try {
        const response = await axios({
            url:`${baseUrl}/products`,
            method:'GET'
        })

        return response
    } catch (e) {
        console.log(e)
    }
}
